import react from "react";

const Dropdown = ({ options }) => {
  const renderedOptions = options.map((item, index) => {
    return (
      <div key={index} className="item">
        {options.label}
      </div>
    );
  });

  return <h1>{options[0].label}</h1>;
};

export default Dropdown;
